import React, { useEffect, useState } from "react";
import "./Components.css";
import Course from "./Course.js";
import axios from "axios";

function CourseTable() {
  const [courses, setCourses] = useState();

  useEffect(() => {
    axios.get("http://localhost:5000/courses").then(function (response) {
      console.log(response);
      setCourses(response.data);
    });

    setCourses();
  }, []);

  var courseItems;
  if (courses) {
    courseItems = courses.map((course) => {
      var exam, lab, project, upg, ktr, hem, bas;
      var keys = [exam, lab, project, upg, ktr, hem, bas];
      var keys_string = ["exam", "lab", "project", "upg", "ktr", "hem", "bas"];

      Object.keys(course).forEach(function (key, index) {
        if (keys_string.includes(key) && course[key]) {
          var index_key = keys_string.indexOf(key);
          keys[index_key] = "X";
        }
      });

      var url = "http://www.google.com/search?q=" + course.code + " liu";

      return (
        <tr>
          <td>
            <div className="form-check">
              <input
                class="form-check-input"
                type="checkbox"
                id="inlineCheckbox1"
                value="option1"
              />
            </div>
          </td>
          <td>{course.code}</td>
          <td>
            <a href={url} target="_blank">
              {course.name}
            </a>
          </td>
          <td>{course.points}</td>
          <td>{course.level}</td>
          <td>{course.block}</td>
          <td>{course.vof}</td>
          <td>{keys[0]}</td>
          <td>{keys[1]}</td>
          <td>{keys[2]}</td>
          <td>{keys[3]}</td>
          <td>{keys[4]}</td>
          <td>{keys[5]}</td>
          <td>{keys[6]}</td>
        </tr>
      );
    });
  }

  console.log(courseItems);

  return (
    <div>
      <Course period={"walla habibi"} />
      <table className="table table-sm">
        <thead>
          <tr>
            <th scope="col">Check</th>
            <th scope="col">Kurskod</th>
            <th scope="col">Kurs</th>
            <th scope="col">Hp</th>
            <th scope="col">Nivå</th>
            <th scope="col">Block</th>
            <th scope="col">VOF</th>
            <th scope="col">TEN</th>
            <th scope="col">LAB</th>
            <th scope="col">PRA</th>
            <th scope="col">UPG</th>
            <th scope="col">KTR</th>
            <th scope="col">HEM</th>
            <th scope="col">BAS</th>
          </tr>
        </thead>
        <tbody>{courseItems}</tbody>
      </table>
    </div>
  );
}

export default CourseTable;
